import React from 'react';

function Brokerage() {
    return ( 
        <div className='container text-center'>
            <div className='row'>
                <div className='col-7'>
                    <a href="/NotFound" className='fs-6'>Brokerage Calculator</a>
                </div>
                <div className='col-5'>
                <a href="/NotFound" className='fs-6'>List of charges</a>
                </div>
            </div>
        </div>
     );
}

export default Brokerage;
